import React, { useState, useEffect } from 'react';
import { View, Text, StyleSheet } from 'react-native';
import word5a from "../asse"

const RandomWordApp = () => {
    const [randomWord, setRandomWord] = useState('diary');

    useEffect(() => {
        const words = ['apple', 'banana', 'carrot', 'diary', 'elephant'];
        const randomIndex = Math.floor(Math.random() * words.length);
        const randomWord = words[randomIndex];
        setRandomWord(randomWord);
    }, []);

    return (
        <View style={styles.container}>
            <Text style={styles.header}>Random Word App</Text>
            <Text style={styles.word}>{randomWord}</Text>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
    header: {
        fontSize: 24,
        color: '#333',
        marginBottom: 20,
    },
    word: {
        fontSize: 48,
        marginTop: 30,
    },
});

export default RandomWordApp;
